{
  "ubx_message": {
    "name": "UBX-NAV-CLOCK",
    "description": "Clock solution",
    "message_class_id": "0x01",
    "message_id": "0x22",
    "message_type": "periodic_polled",
    "firmware_versions": [
      "u-blox 8/u-blox M8 protocol versions 15, 15.01, 16, 17, 18, 19, 19.1, 19.2, 20, 20.01, 20.1, 20.2, 20.3, 22, 22.01, 23 and 23.01"
    ],
    "payload_length": {
      "fixed": 20
    },
    "payload_fields": [
      {
        "byte_offset": 0,
        "data_type": "U4",
        "name": "iTOW",
        "unit": "ms",
        "description": "GPS time of week of the navigation epoch. See the description of iTOW for details."
      },
      {
        "byte_offset": 4,
        "data_type": "I4",
        "name": "clkB",
        "unit": "ns",
        "description": "Clock bias"
      },
      {
        "byte_offset": 8,
        "data_type": "I4",
        "name": "clkD",
        "unit": "ns/s",
        "description": "Clock drift"
      },
      {
        "byte_offset": 12,
        "data_type": "U4",
        "name": "tAcc",
        "unit": "ns",
        "description": "Time accuracy estimate"
      },
      {
        "byte_offset": 16,
        "data_type": "U4",
        "name": "fAcc",
        "unit": "ps/s",
        "description": "Frequency accuracy estimate"
      }
    ]
  }
}
